import './App.css';
import React, {useEffect, useState} from 'react';
import Annotations from './components/Annotation';

function App() {
  var [data, setData] = useState(null);
  useEffect(() => {
    fetch("http://localhost:7777/api/124124331124")
      .then((res) => res.json())
      .then((info) => {
        setData(info) ;
      })
        .catch((error) => console.log(error.message));  
      }, []);


  return (
    <div className="App">
      <header className="App-header">
        {!data ? (
          <div><Annotations /></div>
        ) : (
          <table className="page-table">
            <tr>
              <th style={{width:"75%"}} className="presentation-title"><h1>{data.slides[0].text}</h1></th>
              <th style={{width:"25%"}}>ola</th>
            </tr>
            <tr>
              <td className="slideshow-container">
                <pre>
                  <div className='code fade' id={data?.slides[0].idSlide} name={data.slides[0].text} dangerouslySetInnerHTML={{ __html: data.slides[0].code }}/>
                </pre>
              </td>
              <td className="annotations-container">
               <Annotations variables = {data.variables}/> 
              </td>
            </tr>
            <tr>
              <td className="navigation-container">
                <table style={{width:"100%"}}>
                  <tr style={{display:"flex"}}>
                    <td className="left"><a className="prev" onClick="plusSlides(-1)" href="http://localhost:3000">Previous</a></td>
                    <td className="middle" nota="InsertNavGraph">
                      <div className="graph-container">
                        <svg width="200" height="100" className="graph">
                          <circle cx="20" cy="20" r="5" className="dot" id="dot1" stroke=""></circle>
                          <circle cx="50" cy="50" r="5" className="dot" id="dot2"></circle>
                          <circle cx="80" cy="20" r="5" className="dot" id="dot3"></circle>
                          <line x1="20" y1="20" x2="50" y2="50" stroke="black" />
                          <line x1="50" y1="50" x2="80" y2="20" stroke="black" />
                          <line x1="80" y1="20" x2="120" y2="50" stroke="black" />
                        </svg>
                      </div>
                    </td>
                    <td className="right"><a className="next" onClick="plusSlides(1)"  href="http://localhost:3000">Next</a></td>
                  </tr>
                </table>
              </td>
              <td></td>
            </tr>
          </table>
        )}
      </header>
    </div>
  );
}

export default App;
